The current waste management facility in Powari (Reckong Peo) Kinnaur isn’t in use to store, segregate, compress and transport for recycling. 

We have just started to rebuild the facility (in order to increase its storage capacity), install new machinery, train staff to collect segregated solid waste, train MRF employees for secondary segregation, how to operate machines and eventually transport recyclable material. 

Adding one Mahindra PIKUP to collect & transport solid waste 

In this endeavour we are working with the SADA (Special area development authority) 

Now all we need is support from local folks 

